DROP TABLE IF EXISTS `bank_node`;
CREATE TABLE `bank_node` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent` int(11) NOT NULL,
  `cascade_code` varchar(256) NOT NULL,
  `type_code` int(11) NOT NULL,
  `sheng` varchar(256) NOT NULL,
  `shi` varchar(256) NOT NULL,
  `xian` varchar(256) NOT NULL,
  `name` varchar(256) NOT NULL,
  `creator_name` varchar(50) NOT NULL DEFAULT '',
  `created_at` datetime(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6),
  `updater_name` varchar(50) NOT NULL DEFAULT '',
  `updated_at` datetime(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC;

